import React from "react";
import "./App.css";

const Body: React.FC = () => {
  return (
    <>
      <div className="col">
        <input
          id="searchName"
          className="searchName"
          type="text"
          placeholder="Search..."
        />
        <span className="sortWays">Sort by time | Sort by rate</span>
        <table>
          <tr>
            <td>Rest1</td>
            <td>Rating1</td>
          </tr>
          <tr>
            <td>Rest2</td>
            <td>Rating2</td>
          </tr>
          <tr>
            <td>Rest3</td>
            <td>Rating3</td>
          </tr>
          <tr>
            <td>Rest4</td>
            <td>Rating4</td>
          </tr>
        </table>
      </div>
    </>
  );
};

const AddReview: React.FC = () => {
  return (
    <div className="body">
      <Header />
      <Body />
    </div>
  );
};

export default AddReview;
